class Solution(object):
    def lengthOfLongestSubstring2(self, s, current_len=0):
        """
        :type s: str
        :rtype: int
        """
        chars = {}
        if s.__len__() <= current_len:
            return current_len
        if s.__len__() == 1:
            return 1
        for i in xrange(0, s.__len__()):
            char = s[i]
            if char not in chars:
                chars[char] = i
                continue
            else:
                return self.lengthOfLongestSubstring(s[chars.get(char) + 1:], current_len=chars.__len__())
        return chars.__len__()

    def lengthOfLongestSubstring(self, s, current_len=0):
        """
        :type s: str
        :rtype: int
        """

        if s.__len__() <= current_len:
            return current_len
        if s.__len__() == 1:
            return 1
        pos = 0
        max_len = 0
        while pos < s.__len__() - 1:
            # 判断是否结束
            # print pos, s[pos:]
            if max_len > s.__len__() - 1 - pos:
                return max_len
            chars = {}

            for i in xrange(pos, s.__len__()):
                char = s[i]
                if char not in chars:
                    chars[char] = i
                else:
                    # 找到重复字母
                    pos = chars.get(char) + 1
                    if chars.__len__() > max_len:
                        max_len = chars.__len__()
                    # print "breaking"
                    break
            if chars.__len__() > max_len:
                max_len = chars.__len__()
            if max_len > s.__len__() - 1 - pos:
                return max_len




